import React from 'react';
import './App.css';

function App() {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>INFOV</h1>
      <input
        type="text"
        placeholder="아이디를 입력해주세요 ex.) CU24#편의점"
        style={styles.input}
      />
    </div>
  );
}

const styles = {
  container: {
    height: '100vh',
    backgroundColor: '#0f0f0f',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
  },
  title: {
    fontSize: '72px',
    fontWeight: 'bold',
    color: '#ffffff',
    marginBottom: '30px',
  },
  input: {
    width: '300px',
    height: '40px',
    fontSize: '16px',
    padding: '0 10px',
    borderRadius: '5px',
    border: 'none',
    outline: 'none',
  },
};

export default App;
